import React, { Component } from 'react';

import './MVAnimate.css';

const AnimateText = ({ classStyle, /*classAnimation,*/ text }) => (
    //<div className={`${classStyle} ${classAnimation}`}>
	<div className={`${classStyle}`}>
        <div><p>{text}</p></div>
    </div>
);

export default AnimateText;
